import React, { Fragment } from "react";
import classes from "./Header.module.css";
import headerImage from "../../assets/header-two.jpg";

const Header = (props) => {
  return (
    <React.Fragment>
      <header className={classes.header}>
        <h1>Title</h1>
        <button>Cart</button>
      </header>
      <div className={classes["main-image"]}>
        <img src={headerImage} alt="baked goods on table" />
      </div>
    </React.Fragment>
  );
};

export default Header;
